(73832, 6216, 6690, 1, '只要一分鐘', '', '2014-04-10 00:00:00', 2000, 20, 0, 4, '只要一分鐘　　詞／曲：徐佳瑩\n\n刷牙的時候定格了　穿鞋的時候遲疑了\n散步的時候停下腳步了　我變得不再一樣了\n\n幸福的時候流淚了　難受的時候微笑了\n因為你來過  因為你走了　我想起愛  只要一分鐘\n\n時間一直在佔據　帶走你留下的氣味\n當然我也在努力　想你的時候忘記　想見不得見的恐懼\n我們一直在失去　除了記憶中的那些\n當然我也在努力　學會溫柔地舉起　哭泣後再愛的決定\n\n生活一直在繼續　加深你留下的痕跡\n所以我閉上眼睛　想你的時候忘記　再也不能見的距離\n我們一直在失去　除了記憶中的那天\n所以我閉上眼睛　學會溫柔地想你　你是我愛過的證據\n', '', 244, '徐佳瑩', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2014-04-03 15:21:06', '2015-03-12 14:05:58', '0000-00-00 00:00:00'),
