(73876, 129782, 0, 1, '藍兒', '', '2014-03-30 00:00:00', 2000, 19, 2, 6, '藍兒她 是個好女孩\n大大的眼睛 長長的瀏海\n記得她 常常會發呆\n喜歡看電影 害怕被誣賴\n\n藍兒她 個性活潑可愛\n雖然她偶爾耍耍小無賴\n所以我 偷偷給她關懷\n不讓她受到任何的傷害\n\n喔然而 來到她的面前\n就像個無知孩子一樣\n支支吾吾 說不出我的愛\n\n\n藍兒她 對我不理不采\n自從她發現了我多出的愛\n雖然我知道這就是她\n但心中還是難免會無奈\n\n喔然而 來到她的面前\n就像個無知孩子一樣\n支支吾吾 說不出我的愛\n\n喔然而 她來到我面前\n見到那純潔美麗臉龐\n讓我領悟 別說出我的愛\n\n多年後 又再遇見她\n沒理由 我又為她讓心融化\n提得起 就要放得下\n雖然她 永遠是我的最愛\n', '', 187, '', '蘇安琪', '蘇安琪', '', '', '', 0, 1, 0, '2014-04-03 22:12:22', '2015-03-12 14:05:59', '0000-00-00 00:00:00'),
