(73882, 129782, 0, 1, '大體解剖之歌', '(錄到一半聽到室友開門的聲音所以有一段特別小聲XD)\n\n大體解剖課程是醫學生求學必經的路，\n而本校是將所有的大體課程集中在兩個月內完成，\n對於這兩個月的經歷有感而發。\n\n謹獻給 大體老師以及同組的組員，\n在大體模組快要結束時。', '2014-04-04 00:00:00', 2000, 19, 2, 6, '這兩個月以來 每天往實驗室裡跑\n戴著一層層的口罩 抵擋不了GI的味道\n\n考試前三點睡覺 六點再起來抱佛腳\n在這難熬的解剖課程 還好有你陪我度過\n\n謝謝你 謝謝你\n陪伴我成長 陪伴我憂傷\n陪伴我猜題猜不出來 閉上眼無知的徬徨\n\n\n這兩個多月以來 用福馬林慢性自殺\n戴著一層層的手套 吃飯時手指還有味道\n\n考試前沒辦法睡覺 清晨時聽窗外的鳥叫\n在這難熬的解剖課程 還好有你陪我承受\n\n謝謝你 謝謝你\n陪伴我成長 陪伴我憂傷\n陪伴我猜題猜不出來 閉上眼無知的徬徨\n\n謝謝你 謝謝你\n陪伴我成長 陪伴我堅強\n陪伴我面對自己的未來 擁有更偉大的力量\n\n謝謝你 謝謝你', '', 217, '', '蘇安琪', '蘇安琪', '', '', '', 0, 1, 0, '2014-04-04 23:27:09', '2015-03-12 14:06:00', '0000-00-00 00:00:00'),
(73883, 132803, 0, 1, '敲打、歸屬、寂寞，真實的你虛假的我', '不停對著鍵盤"敲打"著，在對陌生的人產生的認同中，找尋著屬於自我的"歸屬"，卻只是不停的用你的寂寞填滿自己的"寂寞"。活在虛擬的世界，用"虛假的我"去面對原以為"真實的你"。', '2013-03-15 00:00:00', 2000, 10, 0, 7, '(無)', '', 367, '', 'Beware the Sky Falling', '(無)', '', '', '', 0, 1, 0, '2014-04-05 12:02:59', '2015-03-12 14:06:00', '0000-00-00 00:00:00'),
(73884, 129782, 0, 1, '親愛的', '', '2014-03-06 00:00:00', 2000, 19, 2, 6, '親愛的 入夜時你那兒總是清晨 \n親愛的 網站上讀到你的快樂\n親愛的 閉上眼填空白的顏色\n親愛的 我想你了\n\n親愛的 記得那一起放的風箏\n親愛的 你看我的每一個眼神\n親愛的 別說你不記得我的吻\n親愛的 我在等著\n\n\n也許你在別人身上 找尋我的特徵\n也許你不願相信永恆的可能\n才讓愛消失了\n\n親愛的 明天你醒來還是清晨\n親愛的 刷牙洗臉然後坐上公車\n親愛的 我還是會一樣的認真\n期待著 你轉過身\n', '', 228, '', '蘇安琪', '蘇安琪', '', '', '', 0, 1, 0, '2014-04-05 17:38:17', '2015-03-12 14:06:00', '0000-00-00 00:00:00'),
