(73890, 188493, 0, 1, '組曲(貳拾貳+生命有一種絕對)', '', '2014-04-06 00:00:00', 2000, 19, 2, 5, '沒有城市的霓虹　極度地找尋自我\n對於慾望的渴求　如同地球污染那麼多\n總要等到我貳拾貳　開始逆風努力往前走\n灰頭土臉才感受到　這世界訴說著偉大的夢　有殘缺的口\n\n我說　那就飛吧　我的天馬行空\n相同天空有著不同的夢\n平凡的和　特別　說沒空　被操控的都有苦衷\n那就飛吧　我的天馬行空\n反正眼淚是故事始末\n自己感動就是感動\n故事的　全劇終　你陪我　瘋狂走過\n\n我說  想要征服的世界　始終都沒有改變\n那地上無聲蒸發我的淚\n黑暗中期待光線　生命有一種絕對\n等待我　請等待我　靠近我  在擁抱我\n不要走   請不要走\n直到約定融化成笑顏\n\n直到我看見   生命的絕對\n(我說  那就飛吧  我的天馬行空)\n當夢想又再度向我招手\n地圖上未標誌的入口\n就是開啟希望的時候\n\n那就飛吧 我的天馬行空\n每天不停有奇蹟降落\n自己擁有就是永久\n故事的　全劇終　你陪我 　瘋狂走過\n拉拉拉~~~拉拉拉~~~\n故事的　全劇終　你陪我 　瘋狂走過\n直到我看見   生命的絕對', '', 169, '', '', '', '', '蕭綺慧', '', 0, 1, 0, '2014-04-06 13:46:49', '2015-03-12 14:06:00', '0000-00-00 00:00:00'),
