(73897, 225452, 0, 1, 'Love Is', '', '2013-08-04 00:00:00', 2000, 19, 0, 4, 'LOVE   IS              By Jimmy Jang\n               \nVerse 1:\nWhen I was lost in the city of Jungle land.\nNo one else would like to give you a hand.\nMost people focus on their unreality.\n“Self Centered” is name of the game.\nThen you appeared with light of compassion.\nAnd told me unite Soul, body & mind.\nYou showed me how to reach your Holy Land! Yeah…\n\nChorus:  \nLove is Giving, and always sharing.\nLove is Caring, with no conditions.\nLove is forever and never ever ending.\nIf you could spread your LOVE to all the lives you meet.\nTrue love is unconditional from your heart.\nYou are in Heaven!\n\nVerse 2:  \nWhen I see the beasts in their human form.\nAll they care is “How can I rip you off?”\nFriends might betray you and it won’t take long.\n“Selfish & Greedy” you know it’s wrong.\nAnd you showed me what will happen to their life.\nLive without Soul, body and mind.\nThey will have no end of misery after this life!\n\nChorus:   \nLove is Giving, and always sharing.\nLove is Caring, with no conditions.\nLove is forever and never ever ended.\nIf you could spread your LOVE to all the lives you meet.\nTrue love is unconditional from your heart.\nYou are in Heaven!\nLove is Giving, and always sharing.\nLove is Caring, with no conditions.\nLove is forever and never ever ended.\nIf you could spread your LOVE to all the lives you meet.\nTrue love is unconditional from your heart.\nYou are in Heaven!\n\nBridge:  Share you Love, woo…  \n               Give you Love, hum…..\n               Heaven’s door is opened   \n               to anyone with love!\n               Only to those with love! \n               Hum…….\nChorus:\nLove is Giving, and always sharing.\nLove is Caring, with no conditions.\nLove is forever and never ever ended.\nIf you could spread your LOVE to all the lives you meet.\nTrue love is unconditional from your heart.\nYou are in Heaven!\n', '', 211, '', 'Jimmy Jang', 'Jimmy Jang', 'Harry King and Jimmy Jang', 'Monday Rose (ASCAP)', '', 0, 1, 1, '2014-04-07 06:17:06', '2014-04-09 23:26:30', '2014-04-09 23:26:30'),
(73898, 225452, 0, 1, 'For My Beloved', '', '2013-08-05 00:00:00', 2000, 19, 0, 7, 'For My Beloved      By Jimmy Jang\n\nVerse 1:\n Sunlight shining through the shadows of a coconut tree\n Your hazel green eyes reflecting the deep blue sea\n You in my arms, gazing at each other till time standstill\n You show me how true love can be\n\nChorus:\nYou are in my heart and I will love you forever\nWe will never part, my love for you is never ending\nSo much in love, you will always be my lover\nSharing my life with you, with you together\n         \nVerse 2:\nMoon light echo on the winter snow\nYour lips dispelling all the feeling of cold\nTwo hearts uniting each other into one soul\nThere is feeling in me, I want you to know\n\nChorus:  \nYou are in my heart and I will love you forever\nWe will never part, my love for you is never ending\nSo much in love, you will always be my lover\nSharing my life with you, with you together\n\nBridge;\nYou are my fire in the cold wintry night\nYou make my beating heart take flight\nYou warm my body like the tropical twilight\nLighting up my soul, my life completely   \n\nChorus:\nYou are in my heart and I will love you forever\nWe will never part, my love for you is never ending\nSo much in love, you will always be my lover\nSharing my life with you, with you together\nSharing my life with you, with you forever.\n', '', 228, '', 'Jimmy Jang', 'Jimmy Jang', 'Harry King and Jimmy Jang', 'Monday Rose (ASCAP)', '', 0, 1, 1, '2014-04-07 06:23:46', '2014-04-09 08:17:40', '2014-04-09 08:17:40'),
