(73901, 225452, 0, 1, 'We Rock', 'We Rock (我們搖滚吧!  或可稱為: 我們硬的像頑石不靈一樣. 套句李前總統最喜歡用的一句話: 阿丹瑪  控固力, 即頭殼壞去了!)     \nJimmy Jang (張萬生) 作曲, 作詞\nVerse 1:\n在這個世界上, 我們是最偉大的國家之一,\n我們的手中擁有許多高科技.\nWe Rock. We Rock (聽衆自己決定是搖滾, 或是阿丹瑪  控固力  或是頑固的像石頭?)\n我們己把人類送上月球,\n並且向火星挑戰(火星有另一意義為” 戰爭之神”)\nWe Rock, We Rock\n我們自認為地球是宇宙的中心(太張狂了, 光是宇宙銀河系就有幾億而每一宇宙內有上兆的星球, 夜郎自大投胎的).\n正是如此, 我們想怎麼搞都行!\nWe Rock, We Rock.\n要不然你想怎麼樣 (嘿嘿.. 野嘸哩馬安泉  …台語)\n要不然你想怎麼樣 (格老子底, 老子最大)\n所有的科學家都說: 這個世上絕對沒有神, 這號人物.\n正因如此我們想怎麼搞, 都可以!\nWe Rock, We Rock..\n\nChorus:\n她(大地之母)將開始將你搖醒, 震醒…\n大地之母親將以博愛為名. (地母: 常身著黃衣, 掌管並滋養地球上所有生物及寶物, 其下位者為當地之土地, 龍神, 最下為當地的地基主, 有興趣者可参考佛經.)\n她(大地之母) 將要把休給搖醒, 是的, 將把你搖醒(地震…)\n大地之母親將以博愛為名. (由於人類的貪, 嗔, 痴, 我們為了追求欲望, 汚染了空氣, 水源, 大地, 為財, 為名聲, 為權力鬥爭, 誰怕誰, 我有毁滅性武器足足可以炸碎整個地球, 要不然你想怎麼樣 (嘿嘿.. 野嘸哩馬安泉  …台語)\n\nVerse 2:\n我們正在摧毁世上所有雨林(沒有雨林, 森林就沒有氧氣)\n汚染世上所有的水源(沒有淨水, 生物沒辦法存活)\nWe Rock, We Rock\n我們能人工來突變更厲害的病毒, 來做下次的毁滅性殘殺.\n我們巳取代神的位罝來改變所有基因圖譜(蝴蝶, 蜜蜂的神秘死亡主要原因之一, 孟山多種籽/農藥公習為元兇之一, 若無蝴蝶, 蜜蜂播種則農作物大量減少, 糧食則集中於富有國家手中, 許多窮人將大糧饑荒而亡).\n我們是這個世上的金融中心(紐約市華爾街),\n這裹充滿了許多合法的罪犯和衆多的假的所謂精英人物(2008年,1927, 1933年等等多少騙子, 騙了許多投資人的財物, 而不必受控罪入獄, 而跳樓者幾平都是受害人)\nWe Rock. We Rock…\n要不然你想怎麼樣 (嘿嘿.. 野嘸哩馬安泉  …台語)\n要不然你想怎麼樣 (格老子底, 老子最大)\nWe Rock. We Rock..\n我們正式宣告: 我們不是人(那是3隻小猪瑪?), 我們是” 神”\n正因如此我們想怎麼搞, 都可以! (嘿嘿.. 野嘸哩馬安泉  …台語)\nWe Rock, We Rock..\n\nChorus: \n她(大地之母)將開始將你搖醒, 震醒…\n大地之母親將以博愛為名. (地母: 常身著黃衣, 掌管並滋養地球上所有生物及寶物, 其下位者為當地之土地, 龍神, 最下為當地的地基主, 有興趣者可参考佛經.)\n她(大地之母) 將要把休給搖醒, 是的, 將把你搖醒(地震…)\n大地之母親將以博愛為名. (由於人類的貪, 嗔, 痴, 我們為了追求欲望, 汚染了空氣, 水源, 大地, 為財, 為名聲, 為權力鬥爭, 誰怕誰, 我有毁滅性武器足足可以炸碎整個地球, 要不然你想怎麼樣 (嘿嘿.. 野嘸哩馬安泉  …台語)\no歐, 大地之母,\n醒醒吧! ………….\n覺醒吧, 人們,\n我們必須從這場浩劫中覺醒,\n這是一場混亂的浩劫.\n來吧, 來吧…人們\n覺醒吧….以仁愛之名覺醒吧.\n啊! 仁愛, 只有仁慈之愛能治癒這所有一切.\nWe Rock..( 這裡的意義是讓我們搖醒, 覺醒!) \n\n', '2013-08-04 00:00:00', 2000, 19, 0, 1, 'We   Rock   (She will Rock you)    \n\nVerse 1:\nWe are the greatest country in the world,\n having all the High-Tech in our hands.  \nWE  ROCK…WE  ROCK…\nSending people to the Moon and \nchallenging the War Lord of Mars.           \nWE  ROCK… WE  ROCK…\nWe are the center of the Universe,\n we can do whatever we want.              \nWE  ROCK… WE   ROCK…\nWhat you gonna do to us (Huhh…), \nwhat you gonna to us (Huhh…)?     \nWE  ROCK… WE   ROCK…\nScientists say: no GOD exist! \nSo, whatever we wanna do we do.                 \nWE   ROCK… WE  ROCK…   \n\nChorus:\nShe gonna Rock you, Shake you… \nIn the name of Love.  OH! Mother Earth! \nShe gonna wake you, Yeah…wake you…..,\nIn the name of Love. Oh! Mother Earth! \n\nVerse 2:\nWe are destroying all the Rain forests in the world, \npolluting the water and the air. \nWE   ROCK…WE  ROCK…\nMutating the Virus for our next kill and \ntwisting all the genes like we are  GOD!     \nWE  ROCK… WE   ROCK…\nWe are the center of the Financial world \nwith legalized crimes and Freak Elites. \nWE   ROCK… WE  ROCK…\nWhat you gonna do to us (Huhh..), \nWhat you gonna do to Us (Huhh…)? \nWE  ROCK… WE  ROCK…\nWe claimed: We are GOD. \nSo, whatever we wanna to do we do.                \nWE   ROCK… WE  ROCK…\n\nChorus :\nShe gonna Rock you, Shake you…\nIn the name of Love.  OH! Mother Earth! \nShe gonna wake you, Yeah…wake you….., \nIn the name of Love. Oh! Mother Earth!   \nOh! Mother Earth!\nWake up, Wake up, Wake up, \nWake up…people\nWe need to Wake up from this Mess…\nOH…What a mess!\nCome on, Come on, Come on, Come on people  \nWake up, Wake up, Wake up in the name of LOVE! \nOh! Love!\nOnly LOVE can Heal.\nWe ROCK. We ROCK. We ROCK. We ROCK.\n\n', '', 235, '', 'Jimmy Jang', 'Jimmy Jang', 'Harry King and Jimmy Jang', 'Monday Rose (ASCAP)', '', 0, 1, 1, '2014-04-07 06:49:17', '2014-04-09 08:17:47', '2014-04-09 08:17:47'),
