(73950, 10741, 6701, 1, '燃燒瞬間', '', '2014-03-17 00:00:00', 2000, 19, 1, 4, '燃燒瞬間\n词：黄国辉 曲：杨纬璇\n\n灰色的天空 吹著失落的風\n連空氣（呼吸）都冷凍 麻木空洞\n\n何時才能夠 跳出重複的夢\n那希望又落空 信念難守\n\n不忿卡在喉嚨 \n不是說放棄的時候\n\n生命燃燒瞬間\n時針倒數跳躍 \n用盡剩餘時間\n(相信夢想終究都會實現）\n生命燃燒瞬間\n灰飛煙滅之前\n燦爛的火焰照耀明天\n\n明天已不遠 希望在眼前', '', 271, '', '', '', '', 'ah5ive', '', 0, 1, 0, '2014-04-07 13:25:59', '2015-03-12 14:06:02', '0000-00-00 00:00:00'),
(73951, 170713, 0, 1, '你甘知恙', '', '2013-01-01 00:00:00', 2000, 19, 1, 10, '我現在就好像一隻沒人愛的狗\n雨這麼大　卻不知去哪藏\n\n我現在就好像一隻沒人疼的貓\n天這麼冷　卻不知道位叨行\n\n我現在都不想要想　因為越想心越寒\n隨便你都放給你爛　但是越講越捨不得\n\n我的心怎麼這麼軟　說好賣勾打給你\n但接起電話那個聲音　你說那個查某郎是誰\n\n你甘知恙我心有多痛\n別再說一些沒路用的啊\n不想聽你解釋\n不想聽你解釋\n不想聽你解釋\n你說都是白賊話\n\n我在你心內底\n我在你心內底\n我在你心內底\n到底是排幾位', '', 245, '', '林聖淵　', '林聖淵　', 'C2 Studio Vocal Rec', '赤兔', '', 1, 1, 0, '2014-04-07 14:01:33', '2015-03-12 14:06:02', '0000-00-00 00:00:00'),
(73952, 131239, 0, 1, '鏽鉚釘', '', '2014-04-07 00:00:00', 2000, 19, 1, 4, '看見 這世界黑暗的邊緣\n墜跌 是我無能為力改變的殘念\n\n黑夜 吞噬了溫暖的疆界\n殘缺 是我給憤恨的心下的註解\n\n不肯妥協 我也不願去跟隨 這是我驕傲的狼狽\n寒風再吹 也吹不滅這熱淚 倔強的展翅高飛\n\n地平線 是我的起點 不怕天地之間有多遙遠\n我 用音樂改寫 這情節\n\n天際線 是我的終點 就算飛上天會傷痕累累\n我 穿越了殘缺 這信念\n\n聽見 這社會瘋狂的語言\n淪陷 事我不屑同流合汙的膚淺\n\n歲月 征服了佇立的熱血\n粉碎 讓我把落寞的心 徹底告別\n\n不肯妥協 我也不願去跟隨 這是我驕傲的狼狽\n寒風再吹 也吹不滅這熱淚 倔強的展翅高飛\n\n地平線 是我的起點 不怕天地之間有多遙遠\n我 用音樂改寫 這情節\n', '', 221, '', '', '', '', '鏽鉚釘', '', 0, 1, 0, '2014-04-07 14:39:44', '2015-03-12 14:06:02', '0000-00-00 00:00:00'),
(73953, 131239, 0, 1, '河', '', '2014-04-07 00:00:00', 2000, 19, 1, 4, '當夜空他滴落 眼淚的時候\n我只能默默接受 任由傷心的雨暴走\n\n當燄陽他嘶吼 寂寞的時候\n炙熱的陽光 乾涸了我\n\n當生命他脆弱 凋零的時候\n我只能靜靜帶走 躺在我胸口的落寞\n\n當大地需要我 滋潤的時候\n我用盡全力的奔流\n\n穿過山 越過海 只願能付出我所有\n灌溉那 沙漠中 的綠洲\n\n載著夢 不退後 流向了世界的盡頭\n勇敢的 向未知 去摸索\n\n我闖過了荒漠 我熬過了寒冬\n我孤單的時候 有誰能牽著我的手\n我走過了寂寞 我帶走了承諾\n這是我最後的溫柔\n\n\n穿過山 越過海 只願能付出我所有\n灌溉那 沙漠中 的綠洲\n\n載著夢 不退後 流向了世界的盡頭\n勇敢的 向未知 去摸索\n\n我闖過了荒漠 我熬過了寒冬\n我孤單的時候 有誰能牽著我的手\n我走過了寂寞 我帶走了承諾\n這是我最後的溫柔\n', '', 223, '', '', '', '', '鏽鉚釘', '', 0, 1, 0, '2014-04-07 14:41:19', '2015-03-12 14:06:02', '0000-00-00 00:00:00');
